import emoji from "react-easy-emoji";

const user_name = {
    title : "Hello Again!",
    content : "Explore More by connecting with us.",
    next : "Let's Go",
    noMember : "Not a member?",
    register : "Register Now",
    username : "Username",
    contact : "Contact Me"
}
export {
    user_name
};
